import React, { Component } from 'react'

import ee from '../../utils/Events'
export default class Box3 extends Component {
    constructor(){
        super();
        this.state = {
            info:{
                username:'',
                userage:0,
            },
            name
        }
    }
    render() {
        ee.on('Boxmessage',(e)=>{
            this.setState({info:e});
        })
        return (
            <div>
                <p>Box1的用户名为：{this.state.info.username}</p>
                <p>Box1的年龄为：{this.state.info.userage}</p>

                <input type="text" value={this.state.name}/>
            </div>
        )
    }
}
